// SPDX-License-Identifier: MIT
pragma solidity ^0.8.14;

contract ERC20 {
    string public name;
    string public symbol;
    uint256 public totalSupply;

    // 
    mapping(address => uint256) private balances;
    // 
    // 
    mapping(address => mapping(address => uint256)) private allowances;

    // 
    event Transfer(address _from, address _to, uint256 _value);
    // 
    // _owner_spender_value
    event Approval(address _owner, address _spender, uint256 _value);

    // 
    constructor(string memory _name, string memory _symbol, uint256 _totalSupply) {
        name = _name;
        symbol = _symbol;
        totalSupply = _totalSupply;
        // _totalSupplymsg.sender
        balances[msg.sender] = totalSupply;
    }

    // _ownerbalances
    function balanceOf(address _owner) external view returns (uint256) {
        return balances[_owner];
    }

    // 
    function allowance(address _owner, address _spender) public view returns (uint256) {
        // _owner_spenderallowances
        return allowances[_owner][_spender];
    }

    // msg.sender
    // external
    function transfer(address _to, uint256 _value) external returns (bool) {
        _transfer(msg.sender, _to, _value);
        return true;
    }

    // 
    function transferFrom(address _from, address _to, uint256 _value) external returns (bool) {
        // _frommsg.sender_value
        require(allowances[_from][msg.sender] >= _value, "Transfer ammount exceeds allowance");
        _transfer(_from, _to, _value);
        // _value
        allowances[_from][msg.sender] -= _value;
        return true;
    }

    // msg.senderapprove
    function approve(address _spender, uint256 _value) public returns (bool) {
        // _valueallowances
        allowances[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    // transfertransferFrom
    function _transfer(address _from, address _to, uint256 _value) private {
        // _valueNG
        require(_value <= balances[_from], "Insufficient balance");
        // NG
        require(_from != _to, "from = to ... we can't send");
        // _from_value
        balances[_from] -= _value;
        // _to_value
        balances[_to] += _value;
        // 
        emit Transfer(_from, _to, _value);
    }
}
